import React from 'react';

function Header({ navigate }) {
    const handleNavigation = (path) => {
        navigate(path);
    };

    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    <li><button onClick={() => handleNavigation('/about')}>Про клуб</button></li>
                    <li><button onClick={() => handleNavigation('/team')}>Основна команда</button></li>
                    <li><button onClick={() => handleNavigation('/youth')}>Молодіжна команда</button></li>
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

export default Header;
